/// <summary>
/// Get tab page control sequence number on form.
/// </summary>
/// <param name = "_controlName">Tab page name.</param>
/// <returns>Tab page control sequence number on form.</returns>
public int getTabPageControlNum(FormControlName _controlName)
{
    for (int controlIndex = 1; controlIndex <= ctrlTab.controlCount(); controlIndex++)
    {
        if (ctrlTab.controlNum(controlIndex).name() == _controlName)
        {
            return controlIndex;
        }
    }
    throw error(error::wrongUseOfFunction(funcName()));
}

boolean allCovDimUsed()
{
    ListEnumerator  enumerator;
    fieldId         inventDimFieldId;
    fieldId         inventDimParmFieldId;

    if (mapSelectedDim)
    {
        enumerator  = InventDim::dimFieldListEnumerator();
        while (enumerator.moveNext())
        {
            inventDimFieldId = enumerator.current();
            inventDimParmFieldId = InventDim::dim2dimParm(inventDimFieldId);
            if (inventDimParmCov.(inventDimParmFieldId) == NoYes::Yes)
            {
                if ( mapSelectedDim.exists(inventDimFieldId))
                {
                    setSelectedValue  = mapSelectedDim.lookup(inventDimFieldId);
                    if (setSelectedValue.elements() == 0)
                    {
                        return false;
                    }
                }
                else
                {
                    return false;
                }
            }
        }
    }
    return true;
}

/// <summary>
///     Finishes the wizard if the validating conditions are met.
/// </summary>
/// <remarks>
///     The wizard can only be finished if all records to be produced by the wizard are valid.
/// </remarks>
public void closeOk()
{
    if (element.validateCreateReqItemTable())
    {
        super();
    }
}

public NoYes covDimensionMark(
    boolean                 _set,
    NoYes                   _mark,
    fieldId                 _dimField,
    str                     _value)
{
    NoYes   click;

    if (_set)
    {
        if (_mark)
        {
            if (! element.setSelectedValueIn(_dimField,_value))
            {
                element.setSelectedValueAdd(_dimField,_value);
            }
            click = NoYes::Yes;
        }
        else
        {
            if (element.setSelectedValueIn(_dimField,_value))
            {
                element.setSelectedValueRemove(_dimField,_value);
            }
            click = NoYes::No;
        }
    }
    else
        click = element.setSelectedValueIn(_dimField,_value) ? NoYes::Yes : NoYes::No;

    return click;
}

public void createTmpReqItemTable()
{
    ReqItemTable    reqItemTable;

    Set             setCovDimId = new Set(typeName2Type(extendedTypeStr(InventDimId)));
    SetEnumerator   se;

    delete_from tmpReqItemTable where tmpReqItemTable.ItemId == itemId;  // clean up previous selections if moving back and forward

    if (ctrlWizardTask.selectionAsReqItemTableWizardPurpose() == ReqItemTableWizardPurpose::Create)
    {
        if (! inventDimParmCov.isAllFlagNo())
        {
            setCovDimId = Set::create(ReqItemTableWizard::calcCovDimId(itemId,mapSelectedDim.pack()));
            se = setCovDimId.getEnumerator();
            while (se.moveNext())
            {
                tmpReqItemTable.clear();
                tmpReqItemTable.data(reqItemTableTemplate);
                tmpReqItemTable.CovInventDimId = se.current();
                tmpReqItemTable.doInsert();
            }
        }
        else
        {
            tmpReqItemTable.clear();
            tmpReqItemTable.data(reqItemTableTemplate);
            tmpReqItemTable.CovInventDimId = InventDim::inventDimIdBlank();
            tmpReqItemTable.doInsert();
        }
    }
    else
    {
        se = element.parmSetInvalidExistDimId().getEnumerator();
        while (se.moveNext())
        {
            reqItemTable.recordLevelSecurity(true);
            select reqItemTable
                where  reqItemTable.ItemId         == itemId
                    && reqItemTable.CovInventDimId == se.current();

            if (reqItemTable.RecId)
            {
                tmpReqItemTable.data(reqItemTable);
                tmpReqItemTable.doInsert();
            }
        }
    }

    tmpReqItemTable_ds.executeQuery();
}

/// <summary>
///     Enables the minimum and maximum quantity controls for the last page (finish page).
/// </summary>
/// <remarks>
///     The controls that edit the maximum quantity are enabled only if the coverage is set to MinMax.
/// </remarks>
public void enableMinMaxInputLastPage()
{
    boolean enableMaxEditing;
    boolean isCwItem;
    if (#PdsEnabled)
    {
        isCwItem          = PdsGlobal::pdsIsCWItem(itemId);
        enableMaxEditing  = reqItemTableTemplate.isMaxInventOnhandEditable();

        ReqItemTable_MinInventOnhand.allowEdit(!isCwItem);
        ReqItemTable_MinInventOnhand.skip(isCwItem);
        ReqItemTable_MaxInventOnhand.allowEdit(!isCwItem && enableMaxEditing);
        ReqItemTable_MaxInventOnhand.skip(isCwItem || !enableMaxEditing);

        pdsCWQtyMin.allowEdit(isCwItem);
        pdsCWQtyMin.skip(!isCwItem);
        pdsCWQtyMax.allowEdit(isCwItem && enableMaxEditing);
        pdsCWQtyMax.skip(!isCwItem || !enableMaxEditing);

        if (!enableMaxEditing)
        {
            reqItemTableTemplate.pdsCWQtyMax(true, 0);
        }
    }
}

/// <summary>
///     Enables the minimum quantity control, maximum quantity control and related controls for the MinMax settings page.
/// </summary>
/// <remarks>
///     The controls that edit the maximum quantity are enabled only if the coverage is set to MinMax.
/// </remarks>
public void enableMinMaxTabPage()
{
    boolean isCwItem         = PdsGlobal::pdsIsCWItem(itemId);
    boolean enableMaxEditing = reqItemTableTemplate.isMaxInventOnhandEditable();

    MinMax_MinInventOnhand.enabled(!isCwItem);
    MinMax_MaxInventOnhand.enabled(!isCwItem && enableMaxEditing);
    MinMax_MinSafetyKeyId.enabled(reqItemTableTemplate.isMinSafetyKeyIdEditable());
    MinMax_MaxSafetyKeyId.enabled(reqItemTableTemplate.isMaxSafetyKeyIdEditable());
    MinMax_MinSafetyPeriod.enabled(reqItemTableTemplate.isMinSafetyPeriodEditable());

    if (#PdsEnabled)
    {
        MinMax_M_pdsCWQtyMin.enabled(isCwItem);
        MinMax_M_pdsCWQtyMax.enabled(isCwItem && enableMaxEditing);

        if (!enableMaxEditing)
        {
            reqItemTableTemplate.pdsCWQtyMax(true, 0);
        }
    }
}

void init()
{
    ReqParameters::checkPlanningProcessesAreEnabled();

    if (element.args().caller())
    {
        sysWizard = element.args().caller();
    }
    else
    {
        ReqItemTableWizard::main(new Args());
        element.closeCancel();
    }

    itemId = sysWizard.parmItemId();

    super();

    inventDimParmCov.initCovReqItemTable(InventDimGroupSetup::newItemId(itemId));

    mapSelectedDim    = new Map(typeName2Type(extendedTypeStr(FieldId)),Types::Class);
    setSelectedValue  = new Set(Types::String);

    inventStatusTabInitialized   = false;
    inventLocationTabInitialized = false;
    inventSiteTabInitialized     = false;

    this.parmSetInvalidExistDimId(ReqItemTableWizard::findInvalidReqItemTable(itemId));

    welcomeInvalidRecords.text(strFmt(welcomeInvalidRecords.text(),setInvalidExistDimId.elements()));
    element.updateDesign();
}

public NumberOfRecords numOfTmpReqItemTable()
{
    ReqItemTable    reqItemTableBuffer;

    reqItemTableBuffer.setTmp();
    reqItemTableBuffer.setTmpData(tmpReqItemTable);

    select count(RecId) from reqItemTableBuffer;
    return reqItemTableBuffer.RecId;
}

protected Set parmSetInvalidExistDimId(container _setInvalidExistDimId = conNull() )
{
    if (! setInvalidExistDimId)
    {
        setInvalidExistDimId = new Set(Types::String);
    }

    setInvalidExistDimId = _setInvalidExistDimId ? Set::create(_setInvalidExistDimId) : setInvalidExistDimId;

    return setInvalidExistDimId;
}

void setNext()
{
    boolean ok = true;

    if (WelcomePage.isActivePage() &&
        !this.parmSetInvalidExistDimId().elements() && 
        ctrlWizardTask.selectionAsReqItemTableWizardPurpose() == ReqItemTableWizardPurpose::Delete)
    {
        ok = false;
    }

    sysWizard.nextEnabled(ok);
}

public void setSelectedValueAdd(
    fieldId     _dimField,
    str         _value)
{
    if (mapSelectedDim.exists(_dimField))
    {
        setSelectedValue = mapSelectedDim.lookup(_dimField);
        setSelectedValue.add(_value);
        mapSelectedDim.insert(_dimField, setSelectedValue);
    }
    else
    {
        setSelectedValue = new Set(Types::String);
        setSelectedValue.add(_value);
        mapSelectedDim.insert(_dimField, setSelectedValue);
    }
}

protected boolean setSelectedValueIn(
    fieldId     _dimField,
    str         _value)
{
    if (mapSelectedDim.exists(_dimField))
    {
        setSelectedValue = mapSelectedDim.lookup(_dimField);
        return setSelectedValue.in(_value);
    }
    return false;
}

protected void setSelectedValueRemove(
    fieldId     _dimField,
    str         _value)
{
    if (element.setSelectedValueIn(_dimField,_value))
    {
        setSelectedValue = mapSelectedDim.lookup(_dimField);
        setSelectedValue.remove(_value);
        mapSelectedDim.insert(_dimField, setSelectedValue);
    }
}

public void setSelectedValueRemoveAll(fieldId  _dimField)
{
    if (mapSelectedDim && mapSelectedDim.exists(_dimField))
    {
        setSelectedValue = new Set (Types::String);
        mapSelectedDim.insert(_dimField, setSelectedValue);
    }
}

protected boolean showDimPage(fieldId  _dimField)
{
    fieldId         dimField;
    fieldId         dimParmField;

    List                    sortedCovDimFields;
    ListEnumerator          enumerator;

    if (ctrlWizardTask.selectionAsReqItemTableWizardPurpose() == ReqItemTableWizardPurpose::Delete)
    {
        return false;
    }

    dimParmField = InventDim::dim2dimParm(_dimField);

    if (! inventDimParmCov.(dimParmField))
    {
        return false;
    }

    sortedCovDimFields  = InventDim::reverseDimFieldsList(InventDimMetaDataCache::dimCovDimEnabledFieldList());
    enumerator = sortedCovDimFields.getEnumerator();

    while (enumerator.moveNext())
    {
        // move past the elements before _dimField in the reversed list
        if (enumerator.current() == _dimField)
        {
            break;
        }
    }

    // search the rest of the dimensions in prioritized order
    while (enumerator.moveNext())
    {
        dimField = enumerator.current();
        dimParmField = InventDim::dim2dimParm(dimField);

        if (inventDimParmCov.(dimParmField)) // dimension is active and coverage by and allowed as item coverage dimension
        {
            if (mapSelectedDim.exists(dimField))
            {
                setSelectedValue = mapSelectedDim.lookup(dimField);
                if (setSelectedValue && setSelectedValue.elements())
                {
                    return true;
                }
            }
            return false;
        }
    }

    return true;
}

