}

void updateReqItemTable()
{
    #OCCRetryCount
    ReqItemTable    updateReqItemTable;

    try
    {
        ttsbegin;

        while select tmpReqItemTable  // formDs
        {
            select firstonly forupdate updateReqItemTable where updateReqItemTable.ItemId         == tmpReqItemTable.ItemId &&
                                                                updateReqItemTable.CovInventDimId == tmpReqItemTable.CovInventDimId;
            if ( ctrlWizardTask.selectionAsReqItemTableWizardPurpose()== ReqItemTableWizardPurpose::Create )
            {
                if (! updateReqItemTable.RecId)
                {
                    updateReqItemTable.data(tmpReqItemTable);
                    updateReqItemTable.insert();
                }
            }
            else
            {
                updateReqItemTable.delete();
            }
        }

        ttscommit;
    }
    catch(Exception::Deadlock)
    {
        retry;
    }
    catch (Exception::TransientSqlConnectionError)
    {
        if (ReqTransientSqlConnectionErrorHandlingHelper::retryTransientSqlConnectionError())
        {
            retry;
        }
        else
        {
            throw;
        }
    }
    catch (Exception::UpdateConflict)
    {
        if (appl.ttsLevel() == 0)
        {
            if (xSession::currentRetryCount() >= #RetryNum)
            {
                throw Exception::UpdateConflictNotRecovered;
            }
            else
            {
                retry;
            }
        }
        else
        {
            throw Exception::UpdateConflict;
        }
    }
}

/// <summary>
///     Validates that the records to be created are valid.
/// </summary>
/// <returns>
///     true if all records to be created are valid; otherwise, false.
/// </returns>
private boolean validateCreateReqItemTable()
{
    ReqItemTable validateReqItemTable;

    if (ctrlWizardTask.selectionAsReqItemTableWizardPurpose() == ReqItemTableWizardPurpose::Create)
    {
        while select tmpReqItemTable
        {
            select firstonly forupdate validateReqItemTable
                where validateReqItemTable.ItemId == tmpReqItemTable.ItemId
                &&    validateReqItemTable.CovInventDimId == tmpReqItemTable.CovInventDimId;

            if (!validateReqItemTable.RecId)
            {
                validateReqItemTable.data(tmpReqItemTable);
                if (!validateReqItemTable.validateWrite())
                {
                    tmpReqItemTable_DS.markRecord(tmpReqItemTable, 1);
                    return false;
                }
            }
        }
    }
    return true;
}

