public void selectionChanged()
{
    WHSInventStatus whsInventStatusSelected;

    super();

    element.setSelectedValueRemoveAll(fieldNum(InventDim,InventStatusId));

    for (whsInventStatusSelected = this.getFirst(1) ? this.getFirst(1) : this.cursor();
    whsInventStatusSelected;
    whsInventStatusSelected = this.getNext())
    {
        element.setSelectedValueAdd(this.dimFieldId(),whsInventStatusSelected.InventStatusId);
    }
}

