public void pageActivated()
{
    super();

    element.createTmpReqItemTable();

    element.enableMinMaxInputLastPage();

    if (ctrlWizardTask.selectionAsReqItemTableWizardPurpose() == ReqItemTableWizardPurpose::Create)
    {
        if (element.numOfTmpReqItemTable())
        {
            ctrlTextFinish.text("@SYS110961");
        }
        else
        {
            ctrlTextFinish.text("@SYS111016");
        }
    }
    else if (ctrlWizardTask.selectionAsReqItemTableWizardPurpose() == ReqItemTableWizardPurpose::Delete)
    {
        ctrlTextFinish.text("@SYS110960");
    }
}
